import React, { useState } from 'react';
import Navbar from '../components/navbar';
import Footer from '../components/footerComponent';

function Events() {
  const [activeTab, setActiveTab] = useState('all');

  const renderTabContent = () => {
    switch (activeTab) {
      case 'all':
        return (
          <div className="tab-pane show active" id="all" role="tabpanel" aria-labelledby="all-tab">
            {/* All tab content */}
          </div>
        );
      case 'reunions':
        return (
          <div className="tab-pane show active" id="reunions" role="tabpanel" aria-labelledby="reunions-tab">
            {/* Reunions tab content */}
          </div>
        );
      case 'webinars':
        return (
          <div className="tab-pane show active" id="webinars" role="tabpanel" aria-labelledby="webinars-tab">
            {/* Webinars tab content */}
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div>
      <Navbar />
      <div className="container my-4">
        <h1 className="mb-4">Events</h1>
        <p>View upcoming and previous alumni events & conferences from Sunbeam</p>
        <ul className="nav nav-tabs" id="myTab" role="tablist">
          <li className="nav-item">
            <a
              className={`nav-link ${activeTab === 'all' ? 'active' : ''}`}
              id="all-tab"
              href="#all"
              role="tab"
              onClick={() => setActiveTab('all')}
            >
              ALL
            </a>
          </li>
          <li className="nav-item">
            <a
              className={`nav-link ${activeTab === 'reunions' ? 'active' : ''}`}
              id="reunions-tab"
              href="#reunions"
              role="tab"
              onClick={() => setActiveTab('reunions')}
            >
              REUNIONS
            </a>
          </li>
          <li className="nav-item">
            <a
              className={`nav-link ${activeTab === 'webinars' ? 'active' : ''}`}
              id="webinars-tab"
              href="#webinars"
              role="tab"
              onClick={() => setActiveTab('webinars')}
            >
              WEBINARS
            </a>
          </li>
        </ul>
        <div className="tab-content show" id="myTabContent">
          {renderTabContent()}
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default Events;
